public class Student : Person, IStudentManager
{
public string School { get; set; }
public string Major { get; set; }
public DateTime GraduationDate { get; set; }
public string RetrieveStudentInformation()
{
return string.Format("Hi, I am {0} {1}. I go to {2}
where I will earn a degree in {3} in {4}",
GivenName, FamilyName, School, Major,
GraduationDate.ToString("MMMM, yyyy"));
}
}
